import React from "react";
import "./MovieListCard.css";

const MovieListCard = (props) => {
  return (
    <>
      {props.movies.map((movie, index) => (
        <div className="movie_card d-flex ">
          <div className="d-flex justify-content-center align-content-center m-3 movie_card-container">
            <img
              className="movie_card-poster"
              src={movie.poster_path}
              alt="movie-poster"
            ></img>
            <div className="movie_card-info">
              <h3>movie title</h3>
              <span class="green">9.8</span>
            </div>
            <div class="movie_card-releaseDate">
              <h5>2020.02.25</h5>
            </div>
          </div>
        </div>
      ))}
    </>
  );
};

export default MovieListCard;
